import React from 'react';
import { Button } from 'antd';
import { withRouter, Router, NextRouter } from 'next/router';

interface HomeProps {
    router: NextRouter;
    url: Router;
}


const Home: React.FC<HomeProps> = (props) => {

    console.log(props.router!.url);

    return (
        <Button>Home</Button>
    )
}


export default withRouter(Home);
